import React from "react";

const PressServices = () => {
  return (
    <div className="p-6">
      <h1 className="text-3xl font-bold text-gray-800 amiri-font mb-6">
        الخدمات الصحفية
      </h1>
      <p className="text-gray-600">صفحة الخدمات الصحفية قيد التطوير...</p>
    </div>
  );
};

export default PressServices;
